module.exports={nodes:[{id:1,content:'# Work Experience\n\n---\n\nI wear a lot of hats and no matter which I am wearing what excites me is taking products from idea to implementation.\n\n> This is a <a href="https://en.wikipedia.org/wiki/Zooming_user_interface" target="_blank">zooming user interface</a>.\n> \n> - To zoom into a section, click a tile\n> - To go back, click the background'},{id:2,content:'# Google\n\n---\n\n**Title:** Senior UX Engineer  \nMarch 2019 - May 2019\n\nAt Google I worked on the "Think with Google" marketing team creating data visualizations and data interactives.'},{id:3,content:"# HiRoad\n\n---\n\n**Titles:**\n- Senior Front-end Engineer  \nJune 2016 - June 2018\n- Senior Geospatial Engineer  \nJune 2018 - February 2019\n\nAs front-end engineer I worked collaboratively with our product team, breaking work down into user stories and iterating on front-end features.\n\nAs a geospatial engineer I worked with our data science team creating predictive models to enhance mobile telematics."},{id:4,content:"# Salesforce\n\n---\n\n**Title:** Senior UX Engineer  \nJanuary 2016 - June 2016\n\nAs a senior UX engineer I worked in close collaboration with the Salesforce IoT product team delivering technical feedback on feasibility and implementation."},{id:5,content:"# GoPro\n\n---\n\n**Title:** Senior Front-end Engineer  \nAugust 2015 - December 2015\n\nAs a senior front-end engineer I provided engineering expertise in user interfaces across product teams."},{id:6,content:'# Google / Prototyping\n\n---\n\nI prototyped data rich interfaces for "Think with Google" marketing initiatives. My daily work involved iterating on core functionality in response to changing requirements and integrating feedback from business stakeholders.'},{id:7,content:"# Google / Design\n\n---\n\nI participated in weekly design reviews, providing feedback on feasibility for front-end interfaces and data interactives.\n\nI collaborated closely with designers providing guidance on implementation details such as motion design, and interaction."},{id:8,content:'# Google / Engineering\n\n---\n\nI lead front-end development across a number of stacks including <a href="https://dart.dev/" target="_blank">Dart</a>/<a href="https://angulardart.dev/" target="_blank">Angular</a> and <a href="https://www.typescriptlang.org/" target="_blank">Typescript</a>/<a href="https://reactjs.org/" target="_blank">React</a>.\n\nI developed software for generating random data within parameters. Utilizing this software enabled front-end development to coincide with development of back-end services.\n\nIn addition to my other responsibilities I reviewed resumes and conducted interviews of potential front-end engineering candidates.'},{id:9,content:"# HiRoad / Operations\n\n---\n\nI lead operations on a rotating schedule. During rotation I attended daily meetings with customer support and business stakeholders escalating bugs and other service affecting issues.\n\nI documented a set of standard operating procedures for other engineers on rotation."},{id:10,content:'# HiRoad / Prototyping\n\n---\n\nI created an interactive data visualization for project management. The application integrated with <a href="https://www.atlassian.com/software/jira" target="_blank">Jira</a> project management software providing immediate visual feedback on the status of all current projects and identification of blockers.\n'},{id:11,content:'# HiRoad / Design\n\n---\n\nI collaborated closely with our product team creating an interface for viewing past driving data. For this work I jointly filed the patent "Method and System for Visualizing Personal Driving Data".\n\nI regularly interviewed design candidates assessing their ability to articulate design decisions and collaborate with engineering.'},{id:12,content:'# HiRoad / Engineering\n\n---\n\nI developed front-end interfaces and data visualizations with React. I created shared component libraries enabling rapid development and ensuring close parity with design.\n\nI developed unit and integration tests ensuring that product features met specifications.\n\nI jointly filed the patents "Declarative Interface for User Interaction Design" and "System and Methods for the Secure Synchronization of User Interface State Amongst Computing Devices".\n\nI conducted interviews of front-end engineering candidates and facilitated on-site tech challenges.'},{id:13,content:"# Salesforce / Prototyping\n\n---\n\nI prototyped the Salesforce IoT platform editing interface. The interface itself is a state diagram of the different possible states a fleet of IoT devices can be in. I prototyped the mathematics used in generating the layout as well as the interaction model.\n\nIn addition to the editing interface I prototyped the live view which scales the size of each state in the diagram proportionally to the number of devices in that state."},{id:14,content:"# Salesforce / Design\n\n---\n\nI worked as the sole engineer embedded in the Salesforce IoT product team. I provided technical feedback and implementation strategy on iterations of features.\n\nI iterated with designers suggesting changes to interaction models and layout to keep designs consistent."},{id:15,content:'# Salesforce / Engineering\n\n---\n\nI developed layout algorithms and user interface code for the Salesforce IoT editing interface using <a href="https://reactjs.org/" target="_blank">React</a> and <a href="https://d3js.org/" target="_blank">D3</a>.\n\nI collaborated across teams in the development of the Salesforce <a href="https://www.lightningdesignsystem.com/" target="_blank">Lightning Design System</a> and components which build upon it.'},{id:16,content:"# GoPro / Prototyping\n\n---\n\nI prototyped the content upload user experience and the front-end interface of user profiles for the GoPro social platform."},{id:17,content:'# GoPro / Engineering\n\n---\n\nI developed web based features of the GoPro social platform using React.\n\nI contributed to the development of features for GoPro Studio video editing software using <a href="https://www.qt.io/" target="_blank">QT</a> and JavaScript.'},{id:18,content:"# O-X Innovation\n\n---\n\n**Title:** Owner  \nMarch 2007 - Present\n\nAs the owner of O-X Innovation I have participated in projects for a diverse client base. My clients have ranged from artists and architects to multi-national organizations including Microsoft and the United Nations."},{id:19,content:"# O-X / Operations\n\n---\n\nI monitored and maintained client websites hosted on various cloud hosting platforms.\n\nI regularly updated my clients' content management software as I developed new features."},{id:20,content:"# O-X / Prototyping\n\n---\n\nI conducted user research and product development for feature additions to the content management and e-commerce software I developed for my clients.\n\nI contracted as a full-stack developer in prototyping the video upload and sharing interface for a social media platform."},{id:21,content:"# O-X / Design\n\n---\n\nI took project specifications from clients implementing redesigns and feature additions on individual projects.\n\nI designed the interface for the content management and e-commerce software powering my clients' websites."},{id:22,content:"# O-X / Engineering\n\n---\n\nI have worked with a number of different platforms, programming languages, and frameworks in my client work.\n\n**Platforms:** Amazon Web Services, Google Cloud Platform, Heroku, Rackspace\n\n**Programming Languages:** JavaScript, Ruby, Python, PHP\n\n**Frameworks:** React, Angular, D3, Express, Sinatra, Django, Ruby on Rails, Code Igniter\n\n**Content Management Software:** Drupal, Wordpress\n\n**Unit Testing:** Jest, Mocha, Karma"},{id:23,content:"# Gage Design\n\n---\n\n**Title:** Full-stack Engineer  \nNovember 2007 - February 2009\n\nAs a full-stack engineer at Gage Design I developed the front-end and back-end of client websites and administered the content management systems which powered them."},{id:24,content:"# Gage Design / Operations\n\n---\n\nI provided day-to-day operations support for client websites resolving any reported bugs.\n\nI conducted database migrations as needed in response to feature development.\n\nI developed feature additions to our e-commerce platform providing tax code lookups for products sold in effected regions."},{id:25,content:"# Gage Design / Design\n\n---\n\nI designed the editing interface for features in our content management and e-commerce platforms.\n\nI designed the motion interaction for our first client website which used a single page interface."},{id:26,content:"# Gage Design / Engineering\n\n---\n\nI developed database backed websites on the Linux, Apache, MySQL, and PHP (LAMP) stack.\n\nI created client websites built with PHP using the Code Igniter framework."},{id:27,content:"# HiRoad / Data Science\n\n---\n\nI developed machine learning models adding weather predictions to augment existing mobile telematics. Each model was built and trained using Python, SciKit Learn, and Jupyter Notebooks.\n\nI created Extract-Transform-Load (ETL) pipelines generating data sets for training weather models from daily NOAA weather data."}],links:[{from:1,to:2,icon:"google",id:1},{from:1,to:3,icon:"hiroad",id:2},{from:1,to:4,icon:"salesforce",id:3},{from:1,to:5,icon:"gopro",id:4},{from:2,to:6,icon:"plane",id:5},{from:2,to:7,icon:"tools",id:6},{from:2,to:8,icon:"brackets",id:7},{from:3,to:9,icon:"rocket",id:8},{from:3,to:10,icon:"plane",id:9},{from:3,to:11,icon:"tools",id:10},{from:3,to:12,icon:"brackets",id:11},{from:4,to:13,icon:"plane",id:12},{from:4,to:14,icon:"tools",id:13},{from:4,to:15,icon:"brackets",id:14},{from:5,to:16,icon:"plane",id:15},{from:5,to:17,icon:"brackets",id:16},{from:1,to:18,icon:"ox-",id:17},{from:18,to:19,icon:"rocket",id:18},{from:18,to:20,icon:"plane",id:19},{from:18,to:21,icon:"tools",id:20},{from:18,to:22,icon:"brackets",id:21},{from:1,to:23,icon:"gage",id:22},{from:23,to:24,icon:"rocket",id:23},{from:23,to:25,icon:"tools",id:24},{from:23,to:26,icon:"brackets",id:25},{from:3,to:27,icon:"flask",id:26}]};
